class Solution {

    /**
     * @param Integer[] $processorTime
     * @param Integer[] $tasks
     * @return Integer
     */
    function minProcessingTime($processorTime, $tasks) {
        rsort($tasks); // Sort tasks in descending order
        sort($processorTime); // Sort processorTime in ascending order
        $n = count($processorTime);
        $times = array_fill(0, $n, 0); // Initialize times array to store completion times of each processor

        for ($i = 0; $i < count($tasks); $i++) {
            $processorIndex = $i % $n; // Find the processor index in a round-robin fashion
            $times[$processorIndex] = max($times[$processorIndex], $processorTime[$processorIndex]) + $tasks[$i]; // Calculate the new completion time
            $processorTime[$processorIndex] = $times[$processorIndex]; // Update the processor's available time
        }

        return max($times); // Return the maximum time when all tasks are completed
    }
}
